import React from 'react';
import '../css/LogIn.css';
import fbLogo from '../img/fb-logo.png';

class LogIn extends React.Component {
    render() {
        return(
            <div className="container">
                <div className="form-container absolute-center form-size">
                </div>
                <div className="form-size absolute-center logo-space">
                        <i id="icon" class="fa fa-anchor logo" />
                        <br /><br />
                        <span className="logo-text">Log in with Facebook</span>
                        <a className="btn btn-block social-btn facebook" href="">
                        <img src={fbLogo} alt="Facebook" /> Log in with Facebook</a>
                </div>
            </div>
        );
    }
}

export default LogIn;
